import React from "react";
import "../styles/Footer.css";
import SocialBar from "./SocialBar";

const Footer = () => {
  return (
    <footer className="main-footer">

      {/*Agrego el SocialBar al footer*/}
        <SocialBar className="footer-social-bar"/>

        {/*Imagenes cercitifacos*/}
      <div className="certificaciones">
      <img src ="/images/curso.png" alt="Eneagrama"></img>
      <img src ="/images/logo.png" alt="logo"></img>
      <img src ="/images/upv.png" alt="UPV"></img>
      </div>
      <p>&copy; Vicente Montol√≠o Izquierdo 2025 </p>
    </footer>
  );
};

export default Footer;
